def parse_fen(fen):
    fen_parts=fen.split(" ")
    lines=fen_parts[0].split("/")
    moveIDs={"k":1,"q":2,"r":3,"b":4,"n":5,"p":6}
    castle_chars="KQkq"
    board=[]
    for l in lines:
        blanks_left=0
        board_line=[]
        for char in l:
            for b in range(blanks_left):
                board_line.append(0)
            blanks_left=0
            if char.isnumeric():
                blanks_left=int(char)
            else:
                col_mult=1
                if char.isupper():
                    col_mult=-1
                board_line.append(moveIDs[char.lower()]*col_mult)
        for b in range(blanks_left):
            board_line.append(0)
        board.extend(board_line)
    if fen_parts[1]=="w":
        board.append(0)
    else:
        board.append(1)
    for i in castle_chars:
        if i in fen_parts[2]:
            board.append(1)
        else:
            board.append(0)
    if fen_parts[3]=="-":
        board.append(-1)
    else:
        board.append(board_to_number(fen_parts[3]))
    board.extend([int(fen_parts[4]),int(fen_parts[5])])
    return board

